q($,"aP4","ay1",function(){return H.d([A.qV("\u0130lk s\u0131rada hepimizin az \xe7ok tahmin edebilece\u011fi bir b\xf6l\xfcm olan hukuk yer al\u0131yor. K\u0131saltmas\u0131 TM (T\xfcrk\xe7e \u2013 Matematik) yani e\u015fit a\u011f\u0131rl\u0131k (EA) b\xf6l\xfcm\xfcnden mezun olunup okunan bir b\xf6l\xfcm. Fak\xfclteden mezun olduktan sonra ise i\u015f bulma garantisi oldu\u011fundan bu kadar fazla tercih edilmektedir. Ancak bu b\xf6l\xfcm\xfc se\xe7en \xf6\u011frencilerin sistemli \xe7al\u0131\u015fmas\u0131 ve genel olarak kendini geli\u015ftirmek isteyenlerin tercih etmesi gereken bir b\xf6l\xfcmd\xfcr.","Pilot","25.000\u2019den ba\u015flayarak 60.000- 70.000 TL aras\u0131 maa\u015f almaktad\u0131rlar."),A.qV("Hepinizin bildi\u011fi gibi; psikiyatri de, t\u0131p alanlar\u0131ndan bir tanesidir. Psikiyatri uzmanlar\u0131n\u0131n, ki\u015fiye ila\xe7 yazma yetkisi vard\u0131r. Bu ki\u015filer; insanlar\u0131n ruh durumlar\u0131n\u0131, duygusall\u0131klar\u0131n\u0131 ya da \xf6fkelerini kontrol etmesine yard\u0131mc\u0131 olmakla g\xf6revlidirler. Bu y\xfczden de, i\u015fleri olduk\xe7a zor ve me\u015fakkatli bir i\u015ftir. Bu i\u015fi yapan insanlar\u0131n, sab\u0131rl\u0131 ve dirayetli olmalar\u0131 kendileri i\xe7in olduk\xe7a \xf6nemlidir. ","Psikiyatri ","10.000- 12.000 TL civar\u0131nda maa\u015f almaktad\u0131r."),A.qV("T\xfcrkiye\u2019de en \xe7ok tercih edilen meslekler ve kazan\xe7lar\u0131 ara\u015ft\u0131r\u0131ld\u0131\u011f\u0131nda doktorluk mesle\u011fi ilk s\u0131ralarda yer almaktad\u0131r. Doktor olabilmek i\xe7in, olduk\xe7a sab\u0131rl\u0131 ve dirayetli olmak ve y\u0131llarca s\xfcren t\u0131p e\u011fitimini ba\u015far\u0131l\u0131 bir \u015fekilde tamamlamak gerekir. Maa\u015f\u0131n\u0131n iyi olmas\u0131n\u0131n yan\u0131nda, t\u0131p fak\xfcltesini okumak ve sonras\u0131nda uzmanl\u0131k alabilmekte olduk\xe7a zor bir i\u015ftir. T\u0131bb\u0131n bir\xe7ok alan\u0131 oldu\u011fu i\xe7in, doktorlu\u011funda farkl\u0131 alanlar\u0131 vard\u0131r.","Doktor","Uzman hekimi maa\u015f\u0131  ( 14.500- 16.000 TL) aras\u0131ndad\u0131r. Aile Hekimi Maa\u015f\u0131 ise; 10.000 ile 15.000 TL aras\u0131ndad\u0131r. Fakat aile hekimi maa\u015flar\u0131 bulundu\u011funuz semte g\xf6re de de\u011fi\u015fiklik g\xf6stermektedir. Pratisyen Hekim Maa\u015flar\u0131 ise; 9.000 ile 10.000 TL aras\u0131ndad\u0131r."),A.qV("Diyetisyenler, hem devlet hastanelerinde hem de \xf6zel hastanelerde g\xf6rev yapabilmektedirler. Baz\u0131 diyetisyenler, kendi \xf6zel kliniklerini a\xe7arak hizmet verirler. Hatta, sosyal medya \xfczerinden online diyetisyenlik hizmeti verenler de bulunmaktad\u0131r. Bu meslek gruplar\u0131, fazlas\u0131yla kazanmaktad\u0131r. ","Diyetisyenler","Diyetisyenler kamu dairelerinde; 5.000 ile 6.500 tl aras\u0131 bir maa\u015f almaktad\u0131r. Fakat bu mesle\u011fe, \xf6zel bir sekt\xf6rde ba\u015flad\u0131ysan\u0131z; maa\u015f\u0131n\u0131z asgari \xfccret yada asgari \xfccretin biraz daha \xfcst\xfcnde olacakt\u0131r."),A.qV("T\xfcrkiye\u2019de en \xe7ok tercih edilen meslekler ve kazan\xe7lar\u0131 de\u011ferlendirmesinde hem prestij hem de kazan\xe7 anlam\u0131nda ilk s\u0131ralarda yer alan M\xfchendislik, kendi i\xe7erisinde bir\xe7ok alana ayr\u0131lan bir meslek grubudur.","M\xfchendis","Bu ki\u015filerin maa\u015flar\u0131 ise; \xe7al\u0131\u015ft\u0131\u011f\u0131 yere ve ba\u015flad\u0131\u011f\u0131 alana g\xf6re de\u011fi\u015fmektedir. Fakat kamuda \xe7al\u0131\u015fan bir m\xfchendisin, ortalama maa\u015f\u0131; 7.000 ile 10.000 TL aras\u0131nda de\u011fi\u015fiklik g\xf6stermektedir."),A.qV("Veteriner olabilmek i\xe7in, mutlaka \xfcniversitelerin gerekli b\xf6l\xfcm\xfcnden mezun olup, lisans e\u011fitimini alman\u0131z gerekmektedir. Veterinerlik mesle\u011finin bir di\u011fer ismi ise; baytard\u0131r. Veterinerler, hayvan dostlar\u0131m\u0131z\u0131n hastal\u0131klar\u0131 ve tedavi y\xf6ntemleri i\xe7in \xe7al\u0131\u015fan ki\u015filerdir.","Veteriner ","E\u011fer herhangi bir kamu dairesinde veterinerlik yapacaksan\u0131z, ortalama maa\u015f\u0131n\u0131z;  6.000 TL ile 7.300 TL aras\u0131ndad\u0131r. Fakat \xf6zel bir dairede \xe7al\u0131\u015fmay\u0131 d\xfc\u015f\xfcn\xfcyorsan\u0131z; maa\u015flar\u0131n\u0131z, 2.400 TL ile 4.900 TL aras\u0131nda olacakt\u0131r."),A.qV("Mimarl\u0131kta, m\xfchendislik gibi T\xfcrkiye\u2019de en \xe7ok tercih edilen meslekler ve kazan\xe7lar\u0131 s\u0131ralamas\u0131nda \xfcst basamaklarda yer almakta ve m\xfchendislik gibi kendi i\xe7inde farkl\u0131 b\xf6l\xfcmlere ayr\u0131lmaktad\u0131r. Mimarl\u0131k, i\xe7 mimarl\u0131k, mimarl\u0131k ve peyzaj mimarl\u0131\u011f\u0131 olmak \xfczere 3 grupta incelenmektedir. Mimarlar; bah\xe7e tasar\u0131mlar\u0131, ev tasar\u0131mlar\u0131, okul ya da i\u015f yeri tasar\u0131mlar\u0131 olarak de\u011fi\u015fiklik g\xf6stermektedir. Bu mesle\u011fi yapabilmek i\xe7in; hem kendiniz \xe7izim yapman\u0131z, hem de internet \xfczerinde olan; birka\xe7 \xe7izim program\u0131n\u0131 da \xe7ok iyi bir \u015fekilde \xf6\u011frenmeniz gerekmektedir.","Mimar ","7.000 TL ile 10.000 TL aras\u0131nda, olduk\xe7a de\u011fi\u015fiklik g\xf6stermektedir. ")],H.S("q<HK*>"))})
